INSERT INTO `cms_article` VALUES (2, '更新日志', 1, '开发文档', NULL, NULL, '### 1.0.2\n#### 2020-05-17\n- 新功能 \n1. 新增redis监控功能；\n2. 新增消息系统：短信、邮件；\n3. 新增令牌管理；\n4. API接口构建功能演示\n5. 部分功能优化\n- 优化功能\n1. 图片文件上传路径bug修复\n2. 批量删除bug修复\n3. 部分功能优化\n\n### 1.0.1 \n#### 2020-04-18\n- 新功能 \n1. Swagger2集成，接口文档功能实现；\n2. 代码生成功能优化与字段信息支持拖拽、删除；\n3. 增加内容管理模块\n4. entfrm-ui已加入项目中，可直接git\n- 优化功能\n5. 移除jwt，优化代码\n6. 修复菜单构建树bug\n7. 修复数据库管理url保存后异常bug\n8. 修复退出登录刷新bug\n\n### 1.0.0\n#### 2020-04-12\n- 1.0.0正式版发布\n\n### 1.0.0.0405_beta\n#### 2020-04-05\n- 新功能 \n\nactiviti工作流（版本5.22.0）\n\n框架安全增强（xss、sql注入）\n- 优化功能\n\n优化代码生成\n\n### 1.0.0.0331_beta\n#### 2020-03-31\n- 新功能 \n\n新增代码生成 树表（增删改查） \n\n新增API监控 \n\n- 优化功能\n\n优化代码生成 单表（增删改查）\n\n### 1.0.0.0329_beta\n#### 2020-03-29\n\n1.系统管理\n- 机构管理：配置系统组织机构，无限级树结构展现支持数据权限。\n\n- 角色管理：角色菜单权限分配、设置角色按机构进行数据范围权限划分。\n\n- 用户管理：用户是系统操作者，该功能主要完成系统用户配置。\n\n- 菜单管理：配置系统菜单，操作权限，按钮权限标识等。\n\n- 字典管理：对系统中经常使用的一些较为固定的数据进行维护。\n\n- 参数管理：对系统动态配置常用参数。\n\n- 快捷方式：添加顶部、首页快捷方式。\n\n- 文件管理：文件统一管理。\n\n- 终端管理：OAuth2 授权码、Password模式，灵活管理。\n\n- 数据备份：mysql数据库备份与还原。\n\n2.运维监控\n- 定时任务：在线（添加、修改、删除)任务调度包含执行结果日志。\n\n- 数据监控: 监视当前系统数据库连接池状态，可进行分析SQL找出系统性能瓶颈。\n\n- 服务监控: 监视当前系统CPU、内存、磁盘、堆栈等相关信息。\n\n- API监控：restful api 接口调用统计、可视化。\n\n日志监控\n\n- 登录日志：系统正常操作日志记录和查询；系统异常信息日志记录和查询。\n\n- 操作日志：系统登录日志记录查询包含登录异常。\n\n3.开发工具\n- 数据管理：数据库表查询、代码生成。', 0, '0', 'entfrm', '2020-04-02 18:04:57', '', '2020-04-02 18:29:01', NULL, '0');
INSERT INTO `cms_article` VALUES (3, '开发运行', 1, '开发文档', NULL, NULL, '### 准备工作\n```\nJDK >= 1.8 (推荐1.8版本)\nMysql >= 5.6.0 (推荐5.7版本)\nRedis >= 3.0\nMaven >= 3.0\nNode >= 10\n\n```\n### 运行系统\n**本项目为前后端分离项目**\n前往Gitee下载页面(https://gitee.com/entfrm/entfrm-boot)下载后端代码解压到工作目录，在群文件中下载前端代码（文件顺序靠前为最新）\n### 后端运行\n1. 导入entfrm-boot到Idea，菜单 File -&gt; Open，然后找到entfrm-boot目录下pom.xml右键选择 Maven -&gt; Reimport，等待Idea自动导入Maven依赖包；\n2. 打开Navicat Premium（mysql可视化工具）创建数据库entfrm并导入数据脚本entfrm.sql;然后打开entfrm-web模块下application.yml，找到68、70、72修改redis配置，然后找到90、91、92行修改mysql数据库配置；\n3. 打开并运行com.enfrm.web.WebApplication.java.\n\n### 前端运行\n1. 安装前端项目\n```javascript\n# 进入项目目录\ncd entfrm-ui\n\n# 安装依赖\nnpm install\n\n# 强烈建议不要用直接使用 cnpm 安装，会有各种诡异的 bug，可以通过重新指定 registry 来解决 npm 安装速度慢的问题。\nnpm install --registry=https://registry.npm.taobao.org\n\n# 本地开发 启动项目\nnpm run dev\n```\n* 注：node-sass可能会安装失败，请安装Python 2，或者执行命令：cnpm install node-sass --save-dev\n2. 打开游览器，地址栏输入：http://localhost （默认账户 entfrm/123456）\n', 0, '0', 'entfrm', '2020-04-05 21:46:41', '', '2020-04-05 22:36:52', NULL, '0');
INSERT INTO `cms_article` VALUES (4, '系统部署', 1, '开发文档', NULL, NULL, '### 后端部署\nbin/package.bat 在项目的目录下执行，会在项目entfrm-web模块target文件夹下生成entfrm-web.jar，然后将entfrm-web.jar与bin目录下的run.bat放在同一目录，点击run.bat启动系统\n\n1. jar部署方式\n使用命令行执行：java –jar entfrm-web.jar\n\n2. war部署方式\npom.xml packaging修改为war 放入tomcat服务器webapps\n\n### 前端部署\n1. 项目开发完成后，运行如下命令打包项目：\n```bash\n# 打包正式环境\nnpm run build:prod\n\n# 构建测试环境\nnpm run build:stage\n\n```\n* 打包成功后，会在根目录文件夹 dist 生成 ***.js 、***.css、index.html 等静态文件。\n2. 在D盘符下新建entfrm-ui文件夹，然后将打包后dist下的素有文件复制过去；\n3. nginx配置\n```bash\nworker_processes  1;\n\nevents {\n    worker_connections  1024;\n}\n\nhttp {\n    include       mime.types;\n    default_type  application/octet-stream;\n    sendfile        on;\n    keepalive_timeout  65;\n\n    server {\n        listen       80;\n        server_name  localhost;\n\n	location / {\n            root   D:/entfrm-ui;\n	    try_files $uri $uri/ /index.html;\n            index  index.html index.htm;\n        }\n		\n	location /pro/{\n            proxy_pass http://localhost:8888/;\n            proxy_set_header Host $http_host;\n	    proxy_set_header X-Real-IP $remote_addr;\n	    proxy_set_header REMOTE-HOST $remote_addr;\n            proxy_set_header X-Forwarded-For $proxy_add_x_forwarded_for;\n			\n	}\n\n        error_page   500 502 503 504  /50x.html;\n        location = /50x.html {\n            root   html;\n        }\n    }\n}\n```\n4. 环境变量\n所有测试环境或者正式环境变量的配置都在 .env.xxxx 文件中；如.env.production：\n```bash\n# 生产环境配置\nENV = \'production\'\n\n# entfrm开发平台/生产环境 跟nginx配置中的服务路由前缀相同\nVUE_APP_BASE_API = \'/pro\'\n\n```\n5. 常见问题\n* 如果使用Mac或Linux 需要修改application.yml文件路径profile，并确定给的路径文件权限为可读可写。\n', 0, '0', 'entfrm', '2020-04-05 22:55:48', '', '2020-04-05 23:01:04', NULL, '0');
INSERT INTO `cms_article` VALUES (5, '文件结构', 1, '开发文档', NULL, NULL, '- 后端结构\n```language\ncom.entfrm     \n├── auth             // oauth2授权\n│     └── config                       // 授权相关配置\n│     └── controller                   // 通用控制器\n│     └── enhancer                     // 增强器\n│     └── entity                       // 实体\n│     └── handler                      // 常用处理\n│     └── service                      // 服务实现\n|     └── util                         // 工具类\n├── biz              // 业务模块\n│     ├── activiti                     // 工作流\n│     ├── cms                          // 内容管理\n│     ├── toolkit                      // 开发工具\n│     ├── monitor                      // 运维监控\n│     ├── quartz                       // 定时任务\n│     ├── system                       // 系统管理\n|            └── controller                     // 控制器\n│            └── entity                         // 实体\n│            └── mapper                         // 映射器\n│            └── service                        // 接口与实现\n|            └── util                           // 工具类\n\n├── core            // 框架核心\n│     ├── base                        // 基础工具类\n│     ├── data                        // 数据操作\n│     ├── log                         // 操作日志\n│     ├── security                    // 权限控制\n│     ├── swagger                     // swagger文档\n├── web             // 启动程序\n```\n- 配置文件\n```language\n# 项目配置\nentfrm:\n  # 名称\n  name: entfrm快速开发平台\n  # 版本\n  version: 0.1.0\n  # 文件上传路径\n  profile: C:/profile/\n  # 获取ip地址开关\n  addressSwitch: true\n  # redis开关\n  redisSwitch: true\n  #en_US 英语  zh_CN 简体中文\n  lang: zh_CN\n\n# 开发环境配置\nserver:\n  # 服务端口\n  port: 8888\n  servlet:\n    # 项目contextPath\n    context-path: /\n  tomcat:\n    # tomcat的URI编码\n    uri-encoding: UTF-8\n    # tomcat最大线程数，默认为200\n    max-threads: 800\n    # Tomcat启动初始化的线程数，默认值25\n    min-spare-threads: 30\n\n# 用户配置\nuser:\n  password:\n    # 密码错误{maxRetryCount}次锁定10分钟\n    maxRetryCount: 5\n\n# Spring配置\nspring:\n  # 资源信息\n  messages:\n    # 国际化资源文件路径\n    basename: i18n/messages\n    encoding: utf-8\n  # 序列化\n  jackson:\n    time-zone: GMT+8\n    date-format: yyyy-MM-dd HH:mm:ss\n  profiles:\n    active: druid\n  # 文件上传\n  servlet:\n     multipart:\n       max-file-size:  50MB\n       max-request-size:  30MB\n  # 服务模块\n  devtools:\n    restart:\n      # 热部署开关\n      enabled: true\n  # redis 配置\n  redis:\n    # 地址\n    host: localhost\n    # 端口，默认为6379\n    port: 6379\n    # 密码\n    password:\n    # 连接超时时间\n    timeout: 10s\n    lettuce:\n      pool:\n        # 连接池中的最小空闲连接\n        min-idle: 0\n        # 连接池中的最大空闲连接\n        max-idle: 8\n        # 连接池的最大数据库连接数\n        max-active: 8\n        # #连接池最大阻塞等待时间（使用负值表示没有限制）\n        max-wait: -1ms\n  # 数据源配置\n  datasource:\n    type: com.alibaba.druid.pool.DruidDataSource\n    druid:\n      driver-class-name: com.mysql.cj.jdbc.Driver\n      jdbc-url: jdbc:mysql://127.0.0.1:3306/entfrm-boot?characterEncoding=utf8&zeroDateTimeBehavior=convertToNull&useSSL=false&useJDBCCompliantTimezoneShift=true&useLegacyDatetimeCode=false&serverTimezone=GMT%2B8&allowMultiQueries=true\n      username: root\n      password: 123456Aa\n      # 初始连接数\n      initialSize: 5\n      # 最小连接池数量\n      minIdle: 10\n      # 最大连接池数量\n      maxActive: 500\n      # 配置获取连接等待超时的时间\n      maxWait: 60000\n      # 配置间隔多久才进行一次检测，检测需要关闭的空闲连接，单位是毫秒\n      timeBetweenEvictionRunsMillis: 60000\n      # 配置一个连接在池中最小生存的时间，单位是毫秒\n      minEvictableIdleTimeMillis: 300000\n      # 配置一个连接在池中最大生存的时间，单位是毫秒\n      maxEvictableIdleTimeMillis: 900000\n      # 配置检测连接是否有效\n      validationQuery: SELECT 1 FROM DUAL\n      testWhileIdle: true\n      testOnBorrow: false\n      testOnReturn: false\n      statViewServlet:\n        enabled: true\n        # 设置白名单，不填则允许所有访问\n        allow:\n        url-pattern: /druid/*\n      filter:\n        stat:\n        # 慢SQL记录\n        log-slow-sql: true\n        slow-sql-millis: 1000\n        merge-sql: true\n      wall:\n        config:\n          multi-statement-allow: true\n\n# MyBatis Plus\nmybatis-plus:\n  mapper-locations: classpath*:mapper/**/*.xml\n  typeAliasesPackage: com.entfrm.biz.**.entity\n  global-config:\n    # 不显示banner\n    banner: false\n    # 数据库相关配置\n    db-config:\n      #主键类型  AUTO:\"数据库ID自增\", INPUT:\"用户输入ID\",ID_WORKER:\"全局唯一ID (数字类型唯一ID)\", UUID:\"全局唯一ID UUID\";\n      id-type: AUTO\n  configuration:\n    call-setters-on-nulls: true\n\n# 防止XSS攻击\nxss:\n  # 过滤开关\n  enabled: true\n  # 排除链接（多个用逗号分隔）\n  excludes: /cms/article/*\n  # 匹配链接\n  urlPatterns: /system/*,/monitor/*,/quartz/*,/toolkit/*,/activiti/*,/cms/*\n\n# 日志配置\nlogging:\n  level:\n    com.entfrm: debug\n    org.springframework: WARN\n    org.spring.springboot.dao: debug\n```\n- 前端结构\n```language\n├── build                      // 构建相关  \n├── bin                        // 批处理\n├── public                     \n│   ├── favicon.ico            // favicon图标\n│   └── index.html             // 应用入口\n├── src                        \n│   ├── api                    // api请求\n│   ├── assets                 // 主题、字体等静态资源\n│   ├── components             // 全局公用组件\n│   ├── directive              // 全局指令\n│   ├── layout                 // 布局\n│   ├── router                 // 路由\n│   ├── store                  // 全局store管理\n│   ├── utils                  // 全局常用方法\n│   ├── views                  // view视图\n│   ├── App.vue                // 入口页面\n│   ├── main.js                // 入口，组件初始化\n│   ├── permission.js          // 权限管理\n│   └── settings.js            // 系统配置\n├── .editorconfig              // 编码格式\n├── .env.development           // 开发环境配置\n├── .env.production            // 生产环境配置\n├── .env.staging               // 测试环境配置\n├── .eslintignore              // 忽略语法检查\n├── .eslintrc.js               // eslint 配置项\n├── .gitignore                 // git 忽略项\n├── babel.config.js            // babel.config.js\n├── package.json               // package.json\n└── vue.config.js              // vue.config.js\n```\n', 0, '0', 'entfrm', '2020-04-09 00:11:29', '', '2020-04-09 00:20:11', NULL, '0');
