INSERT INTO `cms_article` VALUES (7, '开发规范', 2, '后端文档', NULL, NULL, '> 整个项目遵循《阿里巴巴Java开发手册》代码开发规范\n\n1.业务模块统一放在entfrm-biz下\n\n2.结构规范\n```\n├── system                        //模块\n└──── controller                     // 控制器\n└──── entity                        // 实体\n└──── mapper                        // 映射器\n└──── service                       // 接口与实现\n\n├── resources\n└──── mapper \n└────── system \n```\n3.Controller规范\n```\nprivate QueryWrapper<Article> getQueryWrapper(Article article) {\n    ...\n}\n\n@ApiOperation(\"文章列表\")\n@PreAuthorize(\"@ps.hasPerm(\'article_view\')\")\n@GetMapping(\"/list\")\npublic R list(Page page, Article article) {\n    ...    \n}\n\n@ApiOperation(\"文章查询\")\n@GetMapping(\"/{id}\")\npublic R getById(@PathVariable(\"id\") Integer id) {\n    ...\n}\n\n@OperLog(\"文章新增\")\n@ApiOperation(\"文章新增\")\n@PreAuthorize(\"@ps.hasPerm(\'article_add\')\")\n@PostMapping(\"/save\")\npublic R save(@Validated @RequestBody Article article) {\n    ...\n}\n\n@OperLog(\"文章修改\")\n@ApiOperation(\"文章修改\")\n@PreAuthorize(\"@ps.hasPerm(\'article_edit\')\")\n@PutMapping(\"/update\")\npublic R update(@Validated @RequestBody Article article) {\n     ...\n}\n\n@OperLog(\"文章删除\")\n@ApiOperation(\"文章删除\")\n@PreAuthorize(\"@ps.hasPerm(\'article_del\')\")\n@DeleteMapping(\"/remove/{id}\")\npublic R remove(@PathVariable(\"id\") Integer id) {\n    ...\n}\n\n@PreAuthorize(\"@ps.hasPerm(\'article_export\')\")\n@PostMapping(\"/export\")\npublic R export(Article article) {\n    ...\n}\n```\n', 1, '0', 'entfrm', '2020-04-14 23:49:46', '', '2020-04-14 23:54:19', NULL, '0');
INSERT INTO `cms_article` VALUES (8, '新建一个新模块', 2, '后端文档', NULL, NULL, '1.点击entfrm-biz右键选择**new** =&gt;**Module**进入模块新建引导界面，首先输入包名，然后点击下一步输入模块名称，然后在pom.xml已入核心依赖。\n\n![第一步](http://47.100.3.58/static/show/nm1.gif)\n2.点击左侧菜单**开发工具**=》**数据表管理**，然后选择数据库并点击，右侧并会显示数据库所有表，此时你可以点击配置表（针对已通过数据库可视化工具设计好的表,当然你也可以点击**生成表**，可视化设计数据表），然后依次完善基本信息，字段信息，生成信息（所有命名规范遵循阿里巴巴JAVA开发规范），在字段信息中你可以调整字段在数据库中的类型、长度、默认值等熟悉以及配置代码生成的熟悉，如类型、是否列表显示、查询、查询方式、字典等；最后在生成信息中可以选择单表和树表方式，分类等信息，按上面提示配置即可，配置完后**提交**。\n\n![第二步](http://47.100.3.58/static/show/nm2.gif)\n\n3.返回到列表界面，点击刚刚配置好的表操作栏下的**生成**，系统安装配置参数生成后端和前端所有代码，然后解压并将main这个文件夹放到刚刚创建的模块**src**文件夹下；然后将vue文件夹下两个文件拷贝到前端项目**src**文件夹下；最后将生成的菜单**sql**文件放到数据库中执行（注：记得修改所属父级id），到此重启后台服务，并可在前端中访问刚刚设计的模块功能了。\n\n![第三步](http://47.100.3.58/static/show/nm3.gif)', 1, '0', 'entfrm', '2020-04-14 23:49:46', '', '2020-04-14 23:54:19', NULL, '0');
INSERT INTO `cms_article` VALUES (9, '分页实现', 2, '后端文档', NULL, '分页实现', '> 引用 前端基于Element封装的分页组件 Pagination\n> 后端分页组件使用Mybatis Plus分页插件 PaginationInterceptor\n### 前端实现\n```javascript\n// 一般在查询参数中定义分页变量\nqueryParams: {\n  current: 1,\n  size: 10\n},\n\n// 页面添加分页组件，传入分页变量\n<pagination\n  v-show=\"total>0\"\n  :total=\"total\"\n  :page.sync=\"queryParams.current\"\n  :limit.sync=\"queryParams.size\"\n  @pagination=\"getList\"\n/>;\n\n// 调用后台方法，传入参数 获取结果\nlistUser(this.queryParams).then(response => {\n    this.userList = response.data;\n    this.total = response.total;\n  }\n);\n```\n- 前端传参\n```javascript\n// 查询文章列表\nexport function listArticle(query) {\n  return request({\n    url: \'/cms/article/list\',\n    method: \'get\',\n    params: query\n  })\n}\n```\n前端对axios做了封装，方便request请求、统一相应，详情代码请见：\n[axios封装](https://gitee.com/entfrm/entfrm-boot/blob/master/entfrm-ui/src/utils/request.js)\n### 后端实现\n```java\n    @ApiOperation(\"文章列表\")\n    @PreAuthorize(\"@ps.hasPerm(\'article_view\')\")\n    @GetMapping(\"/list\")\n    @ResponseBody\n    public R list(Page page, Article article) {\n        IPage<Article> articlePage = articleService.page(page, getQueryWrapper(article));\n        return R.ok(articlePage.getRecords(), articlePage.getTotal());\n    }\n```\n分页交给了mybatis plus中的分页实现，此处查询条件由Article接收，再交给getQueryWrapper进行查询条件的解析，最后进行查询。\n```java\nprivate QueryWrapper<Article> getQueryWrapper(Article article) {\n        return new QueryWrapper<Article>()\n                .eq(StrUtil.isNotBlank(article.getTitle()), \"title\", article.getTitle())\n                .eq(!StrUtil.isEmptyIfStr(article.getCategoryId()), \"category_id\", article.getCategoryId())\n                .eq(StrUtil.isNotBlank(article.getStatus()), \"status\", article.getStatus()).orderByAsc(\"sort\");\n    }\n```\ngetQueryWrapper是查询条件解析封装的方法，好处有3点：\n1. 可以重复利用解析查询条件；\n2. 查询条件集中管理，利用代码维护和扩展；\n3. 便于代码生成器自动生成查询条件。\n\n', 1, '0', 'entfrm', '2020-04-15 20:48:47', '', '2020-04-19 12:46:21', NULL, '0');
INSERT INTO `cms_article` VALUES (10, '@OperLog使用', 2, '后端文档', NULL, NULL, '> 在实际开发中，对于某些关键业务操作，我们通常需要记录该操作的内容，一个操作调一次记录方法，每次调阅需要收集时间、参数、谁操作的等等，会造成大量代码重复。 我们希望代码中简化业务相关的操作，在项目中使用注解来完成此项功能。\n\n- 在需要被记录日志的controller方法上添加@OperLog注解，使用方法如下：\n```java\n@OperLog(\"文章新增\")\n```\n支持参数\n参数 |类型 |描述 |\n-------- |-------- |-------- |\nvalue |String |描述 |\n> 逻辑实现代码 [OperLogAspect](https://gitee.com/entfrm/entfrm-boot/blob/master/entfrm-core/entfrm-core-log/src/main/java/com/entfrm/core/log/aspect/OperLogAspect.java)\n\n> 查询操作日志可以登录系统（系统管理->日志监控->操作日志）', -1, '0', 'entfrm', '2020-04-20 09:07:20', '', '2020-04-20 09:13:40', NULL, '1');
INSERT INTO `cms_article` VALUES (11, '导入导出', 2, '后端文档', NULL, NULL, '> 在实际开发中经常需要使用导入导出功能来加快数据的操作。在项目中可以使用注解来完成此项功能。 在需要被导入导出的实体类属性添加@Excel注解，目前支持参数如下：\n\n参数 |类型 |默认值 |描述 |\n-------- |-------- |-------- |-------- |\nname	|String	|空	|导出到Excel中的名字\ndateFormat	|String	|空	|日期格式, 如: yyyy-MM-dd\nconvertExp	|String	|空	|读取内容转表达式 (如: 0=男,1=女,2=未知)\ncellType	|Enum	|Type.STRING	|导出类型（0数字 1字符串）\nheight	|String	|14	|导出时在excel中每个列的高度 单位为字符\nwidth	|String	|16	|导出时在excel中每个列的宽 单位为字符\nsuffix	|String	|空	|文字后缀,如% 90 变成90%\ndefaultValue	|String	|空	|当值为空时,字段的默认值\nprompt	|String	|空	|提示信息\ncombo	|String	|Null	|设置只能选择不能输入的列内容\ntargetAttr	|String	|空	|另一个类中的属性名称,支持多级获取,以小数点隔开\ntype	|Enum	|Type.ALL	|字段类型（0：导出导入；1：仅导出；2：仅导入）\n### 导出实现\n1. 在实体属性上添加@Excel注解\n```java\n@Excel(name = \"用户编号\", cellType = Excel.ColumnType.NUMERIC, prompt = \"用户编号\")\nprivate Integer id;\n\n@Excel(name = \"用户名称\")\nprivate String userName;\n\n@Excel(name = \"用户昵称\")\nprivate String nickName;\n    \n@Excel(name = \"用户性别\", readConverterExp = \"0=男,1=女,2=未知\")\nprivate String sex;\n\n@Excel(name = \"状态\", convertExp = \"0=正常,1=停用\")\nprivate String status;\n    \n@Excel(name = \"最后登录时间\", width = 30, dateFormat = \"yyyy-MM-dd HH:mm:ss\")\nprivate Date loginTime;\n```\n2.在Controller添加导出方法\n```java\n@SneakyThrows\n@OperLog(\"用户数据导出\" )\n@PreAuthorize(\"@ps.hasPerm(\'user_export\')\" )\n@GetMapping(\"/exportUser\" )\n@ResponseBody\npublic R exportUser(User user, HttpServletResponse response, HttpServletRequest request) {\n   List<User> list = userService.list(getQueryWrapper(user));\n   ExcelUtil<User> util = new ExcelUtil<User>(User.class);\n   return util.exportExcel(list, \"用户数据\" );\n}\n```\n3.前端调用\n```javascript\n// 查询参数 queryParams\nqueryParams: {\n  current: 1,\n  size: 10,\n  userName: undefined,\n  phone: undefined,\n  status: undefined,\n  deptId: undefined\n},\n\n// 导出接口exportUser\nimport { exportUser } from \"@/api/system/user\";\n\n/** 导出按钮操作 */\nhandleExport() {\n  const queryParams = this.queryParams;\n  this.$confirm(\'是否确认导出所有用户数据项?\', \"警告\", {\n     confirmButtonText: \"确定\",\n     cancelButtonText: \"取消\",\n     type: \"warning\"\n  }).then(function() {\n     return exportUser(queryParams);\n   }).then(response => {\n     this.download(response.data);\n   }).catch(function() {});\n},\n```\n4.添加导出按钮\n```\n<el-button\n  type=\"warning\"\n  icon=\"el-icon-download\"\n  size=\"mini\"\n  @click=\"handleExport\"\n>导出</el-button>\n```\n### 导入实现\n1.在实体属性上添加@Excel注解，默认为导出导入，也可以单独设置仅导入Type.IMPORT\n```java\n@Excel(name = \"用户编号\", cellType = Excel.ColumnType.NUMERIC, prompt = \"用户编号\")\nprivate Integer id;\n\n@Excel(name = \"用户名称\")\nprivate String userName;\n\n@Excel(name = \"机构名称\")\nprivate String deptName;\n```\n2.在Controller添加导入方法，updateSupport属性为是否存在则覆盖（可选）\n```java\n@SneakyThrows\n@OperLog(\"用户数据导入\" )\n@PreAuthorize(\"@ps.hasPerm(\'user_import\')\" )\n@PostMapping(\"/importUser\" )\n@ResponseBody\npublic R importUser(MultipartFile file, boolean updateSupport) {\n   ExcelUtil<User> util = new ExcelUtil<User>(User.class);\n   List<User> userList = util.importExcel(file.getInputStream());\n   String message = userService.importUser(userList, updateSupport);\n   return R.ok(message);\n}\n```\n3.前端调用\n```\n// 用户导入参数\nupload: {\n  // 是否显示弹出层（用户导入）\n  open: false,\n  // 弹出层标题（用户导入）\n  title: \"\",\n  // 是否禁用上传\n  isUploading: false,\n  // 是否更新已经存在的用户数据\n  updateSupport: 0,\n  // 设置上传的请求头部\n  headers: { Authorization: \"Bearer \" + getToken() },\n  // 上传的地址\n  url: process.env.VUE_APP_BASE_API + \"/system/user/importData\"\n},\n\n// 导入模板接口importTemplate\nimport { importTemplate } from \"@/api/system/user\";\n\n/** 导入按钮操作 */\nhandleImport() {\n  this.upload.title = \"用户导入\";\n  this.upload.open = true;\n},\n/** 下载模板操作 */\nimportTemplate() {\n  importTemplate().then(response => {\n	this.download(response.msg);\n  });\n},\n// 文件上传中处理\nhandleFileUploadProgress(event, file, fileList) {\n  this.upload.isUploading = true;\n},\n// 文件上传成功处理\nhandleFileSuccess(response, file, fileList) {\n  this.upload.open = false;\n  this.upload.isUploading = false;\n  this.$refs.upload.clearFiles();\n  this.$alert(response.msg, \"导入结果\", { dangerouslyUseHTMLString: true });\n  this.getList();\n},\n// 提交上传文件\nsubmitFileForm() {\n  this.$refs.upload.submit();\n}\n```\n4.添加导入按钮\n```\n<el-button\n  type=\"info\"\n  icon=\"el-icon-upload2\"\n  size=\"mini\"\n  @click=\"handleImport\"\n>导入</el-button>\n```\n5.导入前端代码\n```<!-- 用户导入对话框 -->\n<el-dialog :title=\"upload.title\" :visible.sync=\"upload.open\" width=\"400px\">\n  <el-upload\n	ref=\"upload\"\n	:limit=\"1\"\n	accept=\".xlsx, .xls\"\n	:headers=\"upload.headers\"\n	:action=\"upload.url + \'?updateSupport=\' + upload.updateSupport\"\n	:disabled=\"upload.isUploading\"\n	:on-progress=\"handleFileUploadProgress\"\n	:on-success=\"handleFileSuccess\"\n	:auto-upload=\"false\"\n	drag\n  >\n	<i class=\"el-icon-upload\"></i>\n	<div class=\"el-upload__text\">\n	  将文件拖到此处，或\n	  <em>点击上传</em>\n	</div>\n	<div class=\"el-upload__tip\" slot=\"tip\">\n	  <el-checkbox v-model=\"upload.updateSupport\" />是否更新已经存在的用户数据\n	  <el-link type=\"info\" style=\"font-size:12px\" @click=\"importTemplate\">下载模板</el-link>\n	</div>\n	<div class=\"el-upload__tip\" style=\"color:red\" slot=\"tip\">提示：仅允许导入“xls”或“xlsx”格式文件！</div>\n  </el-upload>\n  <div slot=\"footer\" class=\"dialog-footer\">\n	<el-button type=\"primary\" @click=\"submitFileForm\">确 定</el-button>\n	<el-button @click=\"upload.open = false\">取 消</el-button>\n  </div>\n</el-dialog>\n<!-- 用户导入对话框 -->\n<el-dialog :title=\"upload.title\" :visible.sync=\"upload.open\" width=\"400px\">\n  <el-upload\n	ref=\"upload\"\n	:limit=\"1\"\n	accept=\".xlsx, .xls\"\n	:headers=\"upload.headers\"\n	:action=\"upload.url + \'?updateSupport=\' + upload.updateSupport\"\n	:disabled=\"upload.isUploading\"\n	:on-progress=\"handleFileUploadProgress\"\n	:on-success=\"handleFileSuccess\"\n	:auto-upload=\"false\"\n	drag\n  >\n	<i class=\"el-icon-upload\"></i>\n	<div class=\"el-upload__text\">\n	  将文件拖到此处，或\n	  <em>点击上传</em>\n	</div>\n	<div class=\"el-upload__tip\" slot=\"tip\">\n	  <el-checkbox v-model=\"upload.updateSupport\" />是否更新已经存在的用户数据\n	  <el-link type=\"info\" style=\"font-size:12px\" @click=\"importTemplate\">下载模板</el-link>\n	</div>\n	<div class=\"el-upload__tip\" style=\"color:red\" slot=\"tip\">提示：仅允许导入“xls”或“xlsx”格式文件！</div>\n  </el-upload>\n  <div slot=\"footer\" class=\"dialog-footer\">\n	<el-button type=\"primary\" @click=\"submitFileForm\">确 定</el-button>\n	<el-button @click=\"upload.open = false\">取 消</el-button>\n  </div>\n</el-dialog>\n```', -1, '0', 'entfrm', '2020-04-20 10:03:13', '', '2020-04-20 10:11:56', NULL, '0');
INSERT INTO `cms_article` VALUES (12, '数据权限', 2, '后端文档', NULL, NULL, '1.在（系统管理-角色管理）设置需要数据权限的角色 目前支持以下几种权限\n```\n全部数据权限\n自定数据权限\n机构数据权限\n机构及以下数据权限\n仅本人数据权限\n```\n2.在需要数据权限控制方法上添加@DataFilter注解，并在QueryWrapper上增加.apply(StrUtil.isNotBlank(user.getSqlFilter()), user.getSqlFilter())\n```\n    private QueryWrapper<User> getQueryWrapper(User user) {\n        return new QueryWrapper<User>().like(StrUtil.isNotBlank(user.getUserName()), \"user_name\", user.getUserName())\n                .apply(StrUtil.isNotBlank(user.getSqlFilter()), user.getSqlFilter());\n    }\n\n    @PreAuthorize(\"@ps.hasPerm(\'user_view\')\" )\n    @GetMapping(\"/list\" )\n    @DataFilter\n    public R list(Page page, User user) {\n        IPage<User> userIPage = userService.page(page, getQueryWrapper(user));\n        return R.ok(userIPage.getRecords(), userIPage.getTotal());\n    }\n```\n\n> 具体实现代码参见：[com.entfrm.data.aspect.DataFilterAspect](https://gitee.com/entfrm/entfrm-boot/blob/master/entfrm-core/entfrm-core-data/src/main/java/com/entfrm/core/data/aspect/DataFilterAspect.java)', -2, '0', 'entfrm', '2020-04-23 22:46:32', '', '2020-04-25 16:52:13', NULL, '0');
INSERT INTO `cms_article` VALUES (13, '国际化', 2, '后端文档', NULL, NULL, '### 国际化配置\n```\npackage com.entfrm.base.config;\n\nimport org.springframework.context.MessageSource;\nimport org.springframework.context.annotation.Bean;\nimport org.springframework.context.annotation.Configuration;\nimport org.springframework.context.support.ReloadableResourceBundleMessageSource;\n\n/**\n * @author entfrm\n * @date 2020/2/1\n * <p>\n * 国际化配置\n */\n@Configuration\npublic class MessageSourceConfig {\n\n	@Bean\n	public MessageSource messageSource() {\n		ReloadableResourceBundleMessageSource messageSource\n			= new ReloadableResourceBundleMessageSource();\n		messageSource.setBasename(\"classpath:i18n/messages\");\n		return messageSource;\n	}\n}\n```\n### i18n 目录文件下定义资源文件\n简体中文messages_zh_CN.properties\n```\n#通用\nsuccess=操作成功\nfail=操作失败\n\n#login\nsys.password.incorrect=用户名不存在或密码错误\nsys.account.locked=用户已被禁用，请联系管理员\nsys.authentication.fail=当前操作没有权限\n```\n美式英语 messages_en_US.properties\n```\n#common\nsuccess=operate success\nfail=operate fail\n\n#login\nsys.password.incorrect=Incorrect account or password\nsys.account.locked=The account has been locked\nsys.authentication.fail=Account Validation Failed\n```\n### MessageUtil国际化在java中的使用\n> 在application.yml文件配置 默认语言：en_US 英语  zh_CN 简体中文（在第14行）\n```\nMessageUtil.getText(\"success\")\nMessageUtil.getText(\"fail\")\n```\n', 0, '0', 'entfrm', '2020-04-23 22:46:58', '', '2020-04-25 16:49:31', NULL, '0');
INSERT INTO `cms_article` VALUES (14, '多数据源', 2, '后端文档', NULL, NULL, '1.在开发工具->数据库管理中添加新的数据库名称、数据库类型、url、用户和密码，并会自动创建一个别名（组成格式：数据库类型_数据库名称_数据库编号）。\n\n2.在使用的时候请将别名作为参数传递，工具类中有一个别名解析工具类,方便别名解析\n```\npackage com.entfrm.data.util;\n\nimport com.entfrm.base.util.StrUtil;\nimport com.entfrm.data.enums.DataTypeEnum;\nimport lombok.experimental.UtilityClass;\n\n/**\n * @author entfrm\n * @date 2020/3/24\n * @description 别名 工具类\n */\n@UtilityClass\npublic class AliasUtil {\n\n    public String genAlias(String driverClassName, String dsName, int id) {\n        if (DataTypeEnum.MYSQL.getDriverClassName().equals(driverClassName)) {\n            return DataTypeEnum.MYSQL.getType() + \"_\" + dsName + \"_\" + id;\n        } else if (DataTypeEnum.SQLSERVER.getDriverClassName().equals(driverClassName)) {\n            return DataTypeEnum.SQLSERVER.getType() + \"_\" + dsName + \"_\" + id;\n        } else if (DataTypeEnum.ORACLE.getDriverClassName().equals(driverClassName)) {\n            return DataTypeEnum.ORACLE.getType() + \"_\" + dsName + \"_\" + id;\n        } else if (DataTypeEnum.POSTGRESQL.getDriverClassName().equals(driverClassName)) {\n            return DataTypeEnum.POSTGRESQL.getType() + \"_\" + dsName + \"_\" + id;\n        } else if (DataTypeEnum.SQLITE.getDriverClassName().equals(driverClassName)) {\n            return DataTypeEnum.SQLITE.getType() + \"_\" + dsName + \"_\" + id;\n        } else {\n            return dsName;\n        }\n    }\n\n    public String getDsType(String aliass) {\n        return aliass.substring(0, aliass.indexOf(\"_\"));\n    }\n\n    public String getDsName(String aliass) {\n        return aliass.substring(aliass.indexOf(\"_\") + 1, aliass.lastIndexOf(\"_\"));\n    }\n\n    public int getDsId(String aliass) {\n        String dsId = aliass.substring(aliass.lastIndexOf(\"_\") + 1, aliass.length());\n        if(StrUtil.isNotBlank(dsId)){\n            return Integer.parseInt(dsId);\n        }\n        return 1;\n    }\n}\n```\n3.动态数据源使用,参见：[DatatableController](https://gitee.com/entfrm/entfrm-boot/blob/master/entfrm-biz/entfrm-biz-toolkit/src/main/java/com/entfrm/biz/toolkit/controller/DatatableController.java)\n```\n    @GetMapping(\"/list\")\n    @ResponseBody\n    public R list(@RequestParam String alias, @RequestParam(required = false) String tableName) {\n        DSContextHolder.setDSType(AliasUtil.getDsId(alias));\n        //此处实现数据库查询\n        ...\n        return R.ok(list);\n    }\n```\n\n> 动态数据源实现参见：[com.entfrm.data.datasource](https://gitee.com/entfrm/entfrm-boot/tree/master/entfrm-core/entfrm-core-data/src/main/java/com/entfrm/core/data/datasource)', 0, '0', 'entfrm', '2020-04-23 22:47:16', '', '2020-04-25 17:09:24', NULL, '0');
